import React from "react"
import ReactDom from "react-dom"
import './index.css';
import {Explorer, sites} from "adventure-component-library"
import axios from 'axios';

function GetImageWave(props) {
    return (
        <img className = "wave" src = "https://media0.giphy.com/media/ZCwUKGiF877e01bDz3/giphy.gif?cid=ecf05e47c34d3c24a46dd084d8d954fabcb688123d61308b&rid=giphy.gif"/>
    );
}

function GetImageLogo(props) {
    return (
        <img className = "logo" src = "http://13.57.47.139/adventure-logo.png"/>
    );
}

function MMButton(props) {
    return (
        <button className="button" onClick={props.onClick}>
          {props.value}
          id = "mm"
        </button>
      );
}

class App extends React.Component {

    render(){
        return (
            <div>
                <h1>Hi, There!</h1>
                <h2> Request a Hello Token to wave back!</h2>
                <GetImageWave />
                <MMButton />
                <GetImageLogo />
            </div>
        );
    } 
}


ReactDom.render(<App />,document.getElementById("root"));
